DELIMITER //

CREATE PROCEDURE initialize(USER VARCHAR(64), MAX_COUNT INT)
BEGIN
	DECLARE V_COUNTER INT DEFAULT MAX_COUNT;

	WHILE V_COUNTER > 0 DO
		INSERT INTO FILES(USER, FILE_PATH) VALUES(USER, CONCAT('/etc/passwd',V_COUNTER));
		SET V_COUNTER = V_COUNTER - 1;
	END WHILE;
END //

CREATE PROCEDURE check_file(IN USER VARCHAR(64), IN FILE_PATH VARCHAR(256), OUT RET INT)
BEGIN
	SELECT COUNT(*) INTO RET FROM FILES WHERE FILES.USER = USER AND FILES.FILE_PATH = FILE_PATH;
END //

DELIMITER ;

CALL initialize('admin1', 1);
CALL initialize('admin10', 10);
CALL initialize('admin100', 100);
CALL initialize('admin1000', 1000);
CALL initialize('admin10000', 10000);
CALL initialize('admin100000', 100000);